    $arquivo = fopen('Fases_RMS_P/F-'.$fases_mi[$i]['mi'].'.txt','w');
    //verificamos se foi criado
    if ($arquivo == false){
        echo ($i + 1) . ') ERRO ao criar Arquivo de Fases MI: ' . $fases_mi[$i]['mi'] . '.<br>';
        $contador_erro++;
    }
    else{
        echo ($i + 1) . ') Arquivo de Fases MI: ' . $fases_mi[$i]['mi'] . '.Criado com sucesso!<br>';
        $contador_acerto++;
    }

    //escrevemos no arquivo
    $texto = $fases_1 . $fases_2 . $fases_3;

    //Converte Arquivo para ANSI
    $texto = iconv('UTF-8', 'ISO-8859-1', $texto);

    fwrite($arquivo, $texto);

    //Fechamos o arquivo após escrever nele
    fclose($arquivo);
}

echo "<br><br>Acertos: " . $contador_acerto . "<br>Erros: " . $contador_erro . "<br>Total: " . $total;

?>